interface Evidence {
	en_name: string;
	"attach.ico_end_time": Date;
	"attach.sale_price_usd": number; // token发行价格
	"attach.price_usd": number; // 当前价格
	"attach.telegram": number; 
	"attach.hype": number;
	"attach.rating": number;
	"attach.usd_raised": number;
	fxh: number;
}


class ICOData extends Case {
	constructor(opts) {
		super("ico_data", opts);
	}
	async interrogate(culprit, intell) {

		// impl
		let $ = cheerio.load(a);
		let icodatas = $(".item", "#table");
		console.log(icodatas.length);

		let evidences: Evidence[] = [];

		for (var i = 0; i<= icodatas.length - 1; i++) {
			let icodata = icodatas[i];
			let regx = /^[^\[\(]+/;
			let formatData = $(icodata.children[9]).text().trim().split(".");
			let evidence: Evidence = {
				fxh: 0,
				en_name: regx.exec($(icodata.children[3]).text())[0].trim(),
				"attach.ico_end_time": new Date(formatData[2],formatData[1],formatData[0]),
				"attach.sale_price_usd": parseFloat($(icodata.children[11]).text().trim().slice(1).replace(",", "")),
				"attach.price_usd": parseFloat($(icodata.children[13]).text().trim().slice(1).replace(",", "")),
				"attach.telegram": $(icodata.children[19]).text().trim(),
				"attach.hype": $(icodata.children[21]).text().trim(),
				"attach.rating": $(icodata.children[25]).text().trim(),
				"attach.usd_raised": parseFloat($(icodata.children[7]).text().trim().slice(1).replace(",", ""))
			}

			// icodata.children.map((c,i)=>{
			// 	console.log(i,$(c, icodata).text().trim())
			// })

			// console.log(evidence);
			evidences.push(evidence);
			// break;
		}


		return evidences;

	}
	async criminate(evidences: Evidence[], intell: Intelligence) {
		// impl
		let num = 0;
		await x.eachSync(evidences, async(evidence)=> {
			// const url = this.targetDomain + "/api/coin/update?en_name=/" + evidence.en_name + "/i";
			// debug("evidence:", url,evidence);
			
			// let r = await request.patch(url, evidence);
			// if (r.data.data) num++;
			const url = "https://www.feixiaohao.com/currencies/" + evidence.en_name.trim().replace(" ", "-").toLowerCase();
			debug("evidence:", url,evidence);
			try {
				let r = await request.head(url);
				evidence.fxhurl = url;
				evidence.fxh = true;
				if (r.data.data) num++;
			} catch(e) {
				console.log(e.status)
			}
			
			
		});
		fs.writeFileSync("./icodata.json", JSON.stringify(evidences));
		console.log("succed",num)
		return num;
	}

}

